import React from 'react';
import Country from './country.js';
class Data extends React.Component{
    constructor(props){
       super(props)
        this.state={
            dataEl:[]
        }
    }
    data=()=>{
      fetch('http://restcountries.eu/rest/v2/all')
        .then((response) => {
          return response.json;
        })
        .then((some)=>{
            this.setState({
                dataEl:some
            });
        })

    }
    render(){
        return(<div>
        <button onClick={this.data}>data</button>
        <p>{this.state.dataEl.map((data)=> <Country country={data}/> )}</p>        
        </div>)
    }
}
export default Data;
